import Posts from './Components/Posts';
import Header from './Components/Header';
import { Route, Routes } from "react-router-dom";

function App() {
  return (
      <Routes>
        <Route index element={
          <main>
          <Header />
          <Posts />
          <Posts />
          <Posts />
        </main>
        }/>
        <Route path={'/login'} element={
          <main>
          <Header/>
          <div>login page</div>
          </main>
        }/>
      </Routes>
  );
}

export default App;
